    `reviews` VARCHAR(2) CHARACTER SET utf8,
    `createdAt_date` VARCHAR(24) CHARACTER SET utf8,
    `updatedAt_date` VARCHAR(24) CHARACTER SET utf8,
    `v` INT,
    `reviews_name` VARCHAR(13) CHARACTER SET utf8,
    `reviews_rating` INT,
    `reviews_comment` VARCHAR(20) CHARACTER SET utf8,
    `reviews_user_oid` VARCHAR(24) CHARACTER SET utf8,
    `reviews_id_oid` VARCHAR(24) CHARACTER SET utf8,
