	(NULL,'Titanic','/uploads\\image-1735918312017.jpg',1997,NULL,'Film Titanic adalah film drama romantis epik yang disutradarai oleh James Cameron. Ceritanya mengikuti kisah cinta antara Jack Dawson (diperankan oleh Leonardo DiCaprio), seorang pemuda miskin yang menang lotre untuk naik kapal pesiar Titanic, dan Rose DeWitt Bukater (diperankan oleh Kate Winslet), seorang wanita muda dari keluarga kaya yang terikat pada tunangannya, Cal Hockley (diperankan oleh Billy Zane).

Pada tahun 1912, Titanic, kapal terbesar dan termewah yang pernah dibangun, berlayar dalam pelayaran perdananya dari Southampton menuju New York. Selama perjalanan, Rose, yang merasa terjebak dalam kehidupan sosial yang ketat dan pernikahan yang tidak diinginkan, bertemu dengan Jack. Mereka mulai menjalin hubungan yang rumit meskipun perbedaan kelas sosial yang besar.

Namun, perjalanan indah mereka terganggu oleh tragedi besar. Kapal Titanic menabrak gunung es dan mulai tenggelam ke dasar laut. Kejadian ini memicu kekacauan di atas kapal, dan Rose serta Jack berjuang untuk bertahan hidup dalam menghadapi peristiwa yang mengerikan.','Leonardo DiCaprio',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
