	(NULL,'The Conjuring ','/uploads\\image-1735921904281.jpg',2013,NULL,'The Conjuring adalah film horor yang disutradarai oleh James Wan, yang didasarkan pada kisah nyata tentang pasangan penyelidik paranormal, Ed dan Lorraine Warren. Dalam cerita ini, keluarga Perron pindah ke sebuah rumah tua di Rhode Island, di mana mereka mulai mengalami fenomena aneh dan menakutkan. Seiring dengan berjalannya waktu, kejadian-kejadian gaib tersebut semakin menjadi-jadi dan mengancam keselamatan mereka. Keluarga Perron kemudian meminta bantuan dari Ed dan Lorraine Warren, yang menemukan bahwa rumah tersebut dihantui oleh entitas jahat yang sangat kuat.','James Wan',NULL,NULL,NULL,NULL,NULL,'Farhan',0,'Filmnya seram banget',NULL,NULL,NULL,NULL),
