	(NULL,'Joker','/uploads\\image-1735922100114.jpg',2019,NULL,'Joker (2019), disutradarai oleh Todd Phillips, adalah sebuah film psikologis yang mengisahkan asal-usul karakter ikonik Joker, musuh bebuyutan Batman. Film ini berfokus pada Arthur Fleck, seorang pria yang bekerja sebagai badut dan bermimpi menjadi seorang komedian. Arthur hidup di Gotham City yang penuh dengan kesulitan dan ketidakadilan sosial. Ia mengalami kesulitan emosional dan psikologis yang berat, sementara masyarakat dan orang-orang di sekitarnya terus memperlakukan dirinya dengan hina.','Todd Phillips',NULL,NULL,NULL,NULL,NULL,'Farhan',0,'Filmnya seram banget',NULL,NULL,NULL,NULL),
