	(NULL,'Culpa Mia','/uploads\\image-1735922509267.jpg',2023,NULL,'Cupla Mía (2023) adalah sebuah film drama romantis Spanyol yang diangkat dari novel karya Mercedes Ron. Film ini mengisahkan tentang Noah, seorang gadis remaja yang terpaksa pindah ke rumah ayahnya yang kaya dan baru menikah dengan seorang wanita bernama Nina. Noah merasa terasing di lingkungan barunya, tetapi keadaan semakin rumit saat dia mulai jatuh cinta pada Nick, anak tiri ayahnya yang sombong dan misterius.','Nicole Wallace',NULL,NULL,NULL,NULL,NULL,'Farhan',0,'musuh batman',NULL,NULL,NULL,NULL),
