	(NULL,'Babylon','/uploads\\image-1735923470040.jpg',2022,NULL,'Babylon adalah film drama epik yang disutradarai oleh Damien Chazelle, berlatar belakang industri perfilman Hollywood pada masa transisi dari era film bisu ke era film bersuara pada akhir tahun 1920-an. Film ini menggambarkan kehidupan glamor dan penuh kontroversi di dunia perfilman pada masa tersebut.

Cerita mengikuti beberapa karakter utama yang berada di puncak kehidupan sosial dan profesional mereka namun terjerumus dalam kehidupan yang penuh dengan skandal, pesta liar, alkohol, dan kejatuhan moral. Di tengah ketenaran yang meroket, mereka menghadapi perubahan drastis dalam industri film, pergeseran budaya, serta dampak dari ketenaran yang memudar.','Manny Torres',NULL,NULL,NULL,NULL,NULL,'Farhan',0,'musuh batman',NULL,NULL,NULL,NULL),
